import { useParams } from "react-router-dom";

const BlogDetails = () => {
  // exp to grab/add the variable id to the router
  const { id } = useParams();
  return (
    <div className='blog-details'>
      <h2>Blog details -{id}</h2>
    </div>
  );
};

export default BlogDetails;
